import React from 'react';

import './App.css';

import CreateForm from '../CreateForm';

const App = () => {
    return (
        <div className="app">
            <h1 className="title font-weight-bold">Awesome Bike Rental</h1>
            <CreateForm />
        </div>
    );
};

export default App;
